import LineTitle from "../Components/LineTitle"

function GetInTouch() {
    let Content = {
        _id:6, Color: "#EA5C2B",
        Title: "Get It Touch!",
        Content: <span className='VySmFont'>
            Contact <a href="tel:+91-9910584860" className="SmMdFont NavBarText">+91-9910584860</a><br></br>
            Email <a className="SmMdFont NavBarText" href='mailto:dt.rashumalhotra@gmail.com'>dt.rashumalhotra@gmail.com</a>
        </span>
    };

    return(
        <div onclick="showContent()" className="Contact">
        <br></br><br></br><br></br>
        <LineTitle NoLine={true} Light={false} Title="Get In Touch!"/>
        <template>
            {Content.Content}
        </template>
        </div>
    );
}

export default GetInTouch;
